import Head from 'next/head'
import React from "react";
import { useRouter } from 'next/router'
import  { Posts, getStaticProps }  from  '../blog/index';

const Post = () => {
    
    const handleClick = (e) => {
        e.preventDefault()
        router.push('/blog/')
    }

    const router = useRouter()
    let { id } = router.query;

    return (
        <>
            <Head>
                <title>Blog Post: { x } </title>
                <meta name="viewport" content="initial-scale=1.0, width=device-width"/>
            </Head>
            <button onClick={handleClick}>Go Back</button>
            <div>Blog Post { id } Details:</div>

        <div>
                <div>
                    Title: { x }
                    <div>
                        By:
                    </div>
                </div>
            <div>
                Body:
            </div>

        </div>

        <button onClick={handleClick}>AuthorDetails</button>
        </>
        )
    };

export default Post;
